    trackId: '1371565796',
    trackName: 'RAID: Shadow Legends',
    description:
      'Battle your way through a visually-stunning realistic fantasy RPG with hundreds of Champions from 14 playable factions.\n\nTo save the world of Teleria, you will recruit its most legendary warriors from the forces of Light and Darkness. You must train them to fight together, mold them into living weapons, and assemble the greatest raiding party ever seen. \n\nDownload now to join the fight! \n\n⋇FEATURES⋇\n\nDEEP TACTICAL PLAY\nMake tough decisions and equip your champions with powerful artifacts to aid them in their quest. Rank them up to unleash devastating special skills, epic AOE attacks, healing powers and more as you lead them in RPG combat.\n\nFIGHT TOGETHER\nJoin forces with thousands of fellow players in cooperative clan challenges as you slay demons for epic loot, rare Champions, and more.\n\nMASSIVE PVE STORY CAMPAIGN\nExperience epic dark fantasy done right through 12 spectacular locations spread over a sprawling, fully-voiced story campaign. \n\nFIGHT EPIC BOSS BATTLES\nVanquish dozens of challenging bosses for loot, XP, and special champion drops! Cut down fearsome dragons, necromancers, golems, and other fell beasts - then go beat them again for more powerful gear.\n\nPVP ARENA\nTwo teams go in – one team comes out. Go head-to-head with other players to unlock special gear and climb the rankings in intense arena battles. \n\nUNPARALLELED RPG CUSTOMIZATION\nChoose development paths from different masteries and artifacts to give your warriors millions of possible builds. Like in the best old-school RPGs, you have full control of each of your champions attributes, strengths, and weaknesses.\n\nCOLLECT POWERFUL CHAMPIONS\nCollect hundreds of heroes from 14 factions. Assemble balanced teams of Sorcerers, Skinwalkers, Undead, Knights, Elves, and more to defeat your enemies - then recruit them to your side!\n\nVISCERAL 3D ARTWORK\nRaid is a mobile experience that looks and feels like a console RPG. Beautiful, fully-rendered 3D heroes offer stunning detail down to the cracks in their armor.\n\nRaid: Shadow Legends allows you to subscribe to special Raid Cards. Raid Cards will automatically renew after the specified period unless otherwise cancelled.\n\n• 1 Month Silver Raid Card with a FREE 7 Day Trial - $9.99 (First week is free, after that the Card is automatically renewed each month for $9.99. Can be cancelled at any time within the first 6 days of the Trial Period without charge).\n• 1 Month Silver Raid Card - $9.99 (The Card is automatically renewed each month for $9.99).\n• 6 Month Gold Raid Card - $49.99 (The Card is automatically renewed every 6 months for $49.99).\n\nRaid Cards are a subscription purchase. Payment will be charged to your iTunes Account at confirmation of purchase. The subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period. The account will be charged for renewal within 24-hours prior to the end of the current period at the price selected. Subscriptions may be managed and auto-renewal may be turned off by going to Account Settings after purchase. In case of activating a free trial, payment will be charged during the last 24 hours of the free Trial. Any unused portion of a free trial period will be forfeited when a Raid Card purchase is confirmed. Once auto-renew is turned off, subscriptions will retain the bonuses until the end of the active period.\n\nPLEASE NOTE:\n\n• Items are available for purchase in this game. Some paid items may not be refundable depending on the type of item. \n• RAID: Shadow Legends is available in English, Russian, German, French, Spanish, Italian, Ukrainian, Chinese Traditional, Chinese Simplified, Korean, Turkish, Japanese, and Portuguese.\n\nOfficial Website: https://plarium.com/\nSupport: raid.support@plarium.com\nCommunity: https://plarium.com/forum/en/raid-shadow-legends/\nPrivacy Policy: https://plarium.com/en/legal/privacy-and-cookie-policy/\nTerms of Use: https://plarium.com/en/legal/terms-of-use/\nCCPA: https://plarium.com/en/legal/ccpa/',
