    description:
      "Graduate from Moron to Genius as you tap, twist, and shake your way through these fun and tricky mind challenges.\n\nPlay brain teasers and mind puzzles that put your wits to the test. Master the game, then laugh as your friends and family struggle with these seemingly simple puzzles!\n\nThe tricky puzzles include questions that test your memory, reading comprehension, math, patience, problem solving and more! No two questions are exactly alike, but they’re all made to boggle the mind.\n\nProve you’re not an idiot by solving tricky puzzles and brain teasers in record time! Can you tell which item doesn’t belong, or which animal is tallest? The answer might not be as simple as it looks…\n\nThe Moron Test is one of the most popular mobile games ever, with millions of players worldwide. Play now and experience why The Moron Test is an App Store favorite!\n\nThe Moron Test - it's fun to FAIL!\n\nTHE MORON TEST FEATURES:\n\nMIND PUZZLES\n- Tricky tests with simple, addicting gameplay\n- Challenge yourself with clever questions that get harder as you play\n- Six levels featuring hundreds of fun puzzles\n\nGAMES FOR THE BRAIN\n- Memory games that test your memorization\n- Logic games with tricky twists\n- Knowledge games where you have to think fast\n- Trivia games putting your knowledge to use\n- Shapes puzzles with surprising challenges\n- And more!\n\nFUN AND ADDICTING GAMES\n- Funny characters, sound effects, and music\n- Global leaderboards and achievements\n- You will LOVE watching your friends FAIL!\n\nMORON TEST LEVELS:\n- Old School\n- Late Registration\n- Winter Break\n- Food Fight\n- Skip Day\n- Tricky Treat\n\nNO WIFI GAMES\n- Play offline games, no internet required\n\nPlay brain training games and prove you’re not an idiot! Download The Moron Test today.",
